@DepSanderson Observando que essa é quase a proporção dos americanos dispostos a votar numa pessoa desqualificada, burra e esquerdista radical como a Kamala, não duvido de mais nada.
O problema é bem maior do que pensamos...
Deus tenha misericórdia.

Se Kamala vencer:
• A liberdade de expressão está sendo completamente corroída;
• A perda de qualquer chance de obter o DOGE;
• Fim do mercado de criptomoedas;
• Um declínio económico significativo;
• Um risco aumentado de uma Terceira Guerra Mundial.
